WHITNEY X GYMSHARK, ARE YOU KIDDINGGG MEEEE?? She’s done it again 😭👏🙏 so proud, pieces are so lush — launching Thursday the 16th!! Set your alarms!! I’m wearing size small in everything 😊💖
*sizing side note* I def could have sized down in sports bras and crop tops to an XS for a snugger more supportive fit! Shorts and pants fit great in a size small for me! I’m 5’1”, 108 lbs for reference ✨

